import React from 'react';
import './App.scss';
import { getNumber } from './api';

const first = async () => {
  const num = await getNumber()
    .then((response) => {
      return response.json();
    })
    .then((data) => {
      console.log(data);
    })

    return num;
}

console.log(first())

function App() {

  return (
    <div className="App">
    </div>
  );
}

export default App;
